window.bookSummaryJSON = "<p><b>The newest gut-wrenching high-stakes thriller of covert operations by Andrews &amp; Wilson - the&nbsp;</b><b><i>Wall Street Journal</i></b><b>&nbsp;best-selling authors of&nbsp;</b><b><i>Tier One</i></b><b>. </b></p> <p>After a surprise assault on Task Force Ember’s secret compound in Virginia by Russian covert operators, John Dempsey and his teammates are mourning their dead and trying to put the pieces back together. But in the ever-evolving world of shadow warfare, there is no respite for heroes or victims. Russian spymaster Arkady Zhukov, the mind behind the attack on Ember, is at it again - directing false flag operations to destabilize Ukraine and enable Russia to seize control of the Black Sea.&nbsp;</p> <p>The American president designates Arkady and his Zetas a clear and present danger to the United States. Dempsey and his team are tasked to systematically eliminate each and every Zeta agent around the globe. But when American and Russian covert operations collide in Kiev, the “new Cold War” goes from a simmer to a boil. Escalation ensues, bringing America and her allies to the brink of world war. Unless Dempsey and Task Force Ember can derail Russia’s secret plans, the collateral damage could bring the world to its knees.&nbsp;</p> <p><i>Collateral</i> is the sixth installment of the Tier One series - the highest-rated, most authentic pulse-pounding covert-operations thriller series on the market today. Tier One follows the life and operations of former Navy SEAL John Dempsey and Task Force Ember and is written by the <i>WSJ</i>, Audible, and Amazon best-selling coauthor team Andrews &amp; Wilson. Perfect for fans of Tom Clancy, WEB Griffin, Robert Ludlum, Mark Greaney, Brad Thor, Jack Carr, and Tim Tigner.</p>"; 
